    false,nt"url": null,nt"notes": "This metadata record describes the acquisition
    and processing of bare earth lidar data, raw point cloud lidar data, lidar intensity
    data, and floodmap breaklines consisting of a total of 280 sheets for Camp Shelby,
    MS. The post-spacing for this project is 3-meter. This project was broken into 3
    parts, Acquisition, Part A Processing, and Part B Processing. Acquisition was tasked
    by Mississippi Geographic Information, LLC (MGI); Work Order No. ED-5. Part A Processing
    was tasked by MGI; Work Order No. ED-7. Part B Processing was tasked by MGI; Work
    Order No. ED-8. EarthData International, Inc. (EarthData) is a member of MGI and
    was authorized to undertake this project in accordance with the terms and conditions
    of the Professional Services Agreement between MGI and the Mississippi Department
    of Environmental Quality (MDEQ), dated February 17, 2004, and in accordance with
    MGI Task Order No. 18a. This project is being delivered to the City of Hattiesburg,
    Camp Shelby, USGS, and MDEQ. Products developed for the City of Hattiesburg (City
    of 1. Final lidar data georeferenced to MS State Plane East Zone, NAD83, NAVD88,
    US Survey foot 2. Bare earth lidar data in ASCII format and LAS format 3. Raw point
    cloud lidar data in LAS format 4. Lidar intensity data in TIF format 5. Digital
    flight line index in ESRI-compatible format 6. Survey control report 7. Lidar processing
    report Products developed for Camp Shelby (Part A) include the 1. Final lidar data
    georeferenced to UTM Zone 16 North, NAD83, NAVD88, meters 2. Bare earth lidar data
    in ASCII format and LAS format 3. Raw point cloud lidar data in LAS format 4. Lidar
    intensity data in TIF format 5. Digital flight line index in ESRI-compatible format
    6. Survey control report 7. Lidar processing report Products developed for USGS
    (Part A and Part B) include 1. Final lidar data georeferenced to MS State Plane
    East Zone, NAD83, NAVD88, US Survey foot 2. Bare earth lidar data in ASCII format
    and LAS format 3. Raw point cloud lidar data in LAS format 4. Lidar intensity data
    in TIF format 5. Digital flight line index in ESRI-compatible format 6. Survey control
    report 7. Lidar processing report Products developed for MDEQ (Part A and Part B)
    include 1. Final lidar data georeferenced to MS State Plane East Zone, NAD83, NAVD88,
    US Survey foot 2. Bare earth lidar data in ASCII format and LAS format 3. Raw point
    cloud lidar data in LAS format 4. Lidar intensity data in TIF format 5. Floodmap
    breaklines in ESRI shapefile format 6. Digital flight line index in ESRI-compatible
    format 7. Survey control report 8. Lidar processing report",nt"license_title":
